import AxiosTest from '@/components/ AxiosTest.vue';
export default {
  data() {
    return {
      axios: new AxiosTest(),

      week_label: []

      oxygen_day_1m: new Array(24).fill(0),
      oxygen_day_3m: new Array(24).fill(0),
      oxygen_day_6m: new Array(24).fill(0),
      oxygen_day_9m: new Array(24).fill(0),
      oxygen_day_11m: new Array(24).fill(0),

      oxygen_week_1m: new Array(24).fill(0),
      oxygen_week_3m: new Array(24).fill(0),
      oxygen_week_6m: new Array(24).fill(0),
      oxygen_week_9m: new Array(24).fill(0),
      oxygen_week_11m: new Array(24).fill(0),
    };
  },
  mounted() {
      this.load_data_day();
      this.load_data_week();
  },
  methods: {
      async load_data_day(){
          await this.axios.get_day_data();
          this.oxygen_day_1m = [...Array<number>(24)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.day_data[1][index].oxygen);
                      });
          this.oxygen_day_3m = [...Array<number>(24)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.day_data[3][index].oxygen);
                      });
          this.oxygen_day_6m = [...Array<number>(24)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.day_data[6][index].oxygen);
                      });
          this.oxygen_day_9m = [...Array<number>(24)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.day_data[9][index].oxygen);
                      });
          this.oxygen_day_11m = [...Array<number>(24)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.day_data[11][index].oxygen);
                      });
          console.log(this.oxygen_day_1m);
      },
      async load_data_week(){
          await this.axios.get_week_data();
          this.oxygen_week_1m = [...Array<number>(7)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.week_12_data[1][index].oxygen);
                      });
          this.oxygen_week_3m = [...Array<number>(7)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.week_12_data[3][index].oxygen);
                      });
          this.oxygen_week_6m = [...Array<number>(7)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.week_12_data[6][index].oxygen);
                      });
          this.oxygen_week_9m = [...Array<number>(7)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.week_12_data[9][index].oxygen);
                      });
          this.oxygen_week_11m = [...Array<number>(7)].map((_,index)=>{
                          // extract_dataは配列でなく、整数キー（水深）の連想配列
                          return Number(this.axios.week_12_data[11][index].oxygen);
                      });
          console.log(this.oxygen_week_1m);
      }
  }
};
